// This module verifies a WebAuthn Registration Credential according to the W3C WebAuthn spec:
// https://www.w3.org/TR/webauthn/#sctn-registering-a-new-credential
// The Duo Labs python implementation was used as a reference:
// https://github.com/duo-labs/py_webauthn/blob/master/webauthn/registration/verify_registration_response.py

use crate::helpers::parsers::{parse_attestation_object, parse_registration_client_data_json};
use crate::structs::backup::CredentialDeviceType;
use crate::structs::fundamental::{AttestationFormat, ClientDataType, CollectedClientData};
use crate::structs::registration::RegistrationCredential;

// Information about a verified attestation of which an RP can make use.
//
// Attributes:
//     `credential_id`: The generated credential's ID
//     `credential_public_key`: The generated credential's public key
//     `sign_count`: How many times the authenticator says the credential was used
//     `aaguid`: A 128-bit identifier indicating the type and vendor of the authenticator
//     `fmt`: The attestation format
//     `credential_type`: The literal string "public-key"
//     `user_verified`: Whether the user was verified by the authenticator
//     `attestation_object`: The raw attestation object for later scrutiny
// TODO: check max sizes
pub struct VerifiedRegistration<let L: u32, let M: u32, let N: u32, let O: u32> {
    credential_id: [u8; L],
    credential_public_key: [u8; M],
    sign_count: u64,
    aaguid: str<N>,
    fmt: AttestationFormat,
    credential_type: str<10>, // public key credential type
    user_verified: bool,
    attestation_object: [u8; O],
    credential_device_type: CredentialDeviceType,
    credential_backed_up: bool,
}

// Verify an authenticator's response to navigator.credentials.create()
//
// Args:
// TODO: handle credential multi type support
//     - `credential`: The value returned from `navigator.credentials.create()`. Can be either a
//       stringified JSON object, a plain dict, or an instance of RegistrationCredential
//     - `expected_challenge`: The challenge passed to the authenticator within the preceding
//       registration options.
//     - `expected_rp_id`: The Relying Party's unique identifier as specified in the preceding
//       registration options.
//     - `expected_origin`: The domain, with HTTP protocol (e.g. "https://domain.here"), on which
//       the registration should have occurred. Can also be a list of expected origins.
// TODO: implement optional arguments
//     - (optional) `require_user_verification`: Whether or not to require that the authenticator
//       verified the user.
//     - (optional) `supported_pub_key_algs`: A list of public key algorithm IDs the RP chooses to
//       restrict support to. Defaults to all supported algorithm IDs.
//     - (optional) `pem_root_certs_bytes_by_fmt`: A list of root certificates, in PEM format, to
//       be used to validate the certificate chains for specific attestation statement formats.
//
// Returns:
//     Information about the authenticator and registration
//
// Raises:
//     `helpers.exceptions.InvalidRegistrationResponse` if the response cannot be verified
// TODO: check max length types
pub fn verify_registration_response<let K: u32, let L: u32, let N: u32, let O: u32, let S: u32, let U: u32>(
    credential: RegistrationCredential,
    expected_challenge: [u8; U],
    expected_rp_id: [u8; K],
    expected_origin: [u8; 17], // TODO: switch back to S after parse_client_data_json is implemented
) {
    // TODO: return VerifiedRegistration, which provides the public key & sign count needed for authn
    // FIDO-specific check
    // TODO: resolve issues with variable length
    // let encoded_cred: [u8; L] =
    //     noir_base64::BASE64_URL_ENCODER.encode(credential.raw_id().storage());
    // assert(
    //     encoded_cred == credential.id(),
    //     f"InvalidRegistrationResponse: id and raw_id were not equivalent",
    // );
    // 3. Let response be credential.response. If response is not an instance of
    // AuthenticatorAttestationResponse, abort the ceremony with a user-visible error.
    // Fido-specific check for credential type is performed when creating RegistrationCredential
    let response = credential.response();
    //
    // SKIP OPTIONAL
    // 4. Let clientExtensionResults be the result of calling credential.getClientExtensionResults().
    //
    // 5. Let JSONtext be the result of running UTF-8 decode on the value of response.clientDataJSON.
    // TODO
    let client_data_json = response.client_data_json();
    // 6. Let C, the client data claimed as collected during the credential creation, be the result
    // of running an implementation-specific JSON parser on JSONtext.
    // TODO
    let origin = "https://localhost".as_bytes();
    let client_data =
        CollectedClientData::new(ClientDataType::WEBAUTHN_CREATE, expected_challenge, origin);
    // let client_data = response.parse_client_data_json();
    // let client_data: CollectedClientData<32, 17, _, 15> = parse_registration_client_data_json::<N>(client_data_json);
    // 7. Verify that the value of C.type is webauthn.create.
    let credential_type = client_data.credential_type();
    let expected = ClientDataType::WEBAUTHN_CREATE;
    assert(
        client_data.credential_type() == ClientDataType::WEBAUTHN_CREATE,
        f"InvalidRegistrationResponse: Unexpected client data type {credential_type}, expected {expected}",
    );
    // 8. Verify that the value of C.challenge equals the base64url encoding of options.challenge.
    // let encoded_challenge: [u8; 32] =
    //     noir_base64::BASE64_ENCODER_URL_SAFE.encode(expected_challenge);
    assert(
        client_data.challenge() == expected_challenge,
        "InvalidRegistrationResponse: Client data challenge was not expected challenge",
    );
    // 9. Verify that the value of C.origin matches the Relying Party's origin.
    let origin = client_data.origin();
    assert(
        client_data.origin() == expected_origin,
        f"InvalidRegistrationResponse: Unexpected client data origin {origin}, expected {expected_origin}",
    );
    //
    // SKIP FOR NOW
    // 10. Verify that the value of C.tokenBinding.status matches the state of Token Binding for the
    // TLS connection over which the assertion was obtained. If Token Binding was used on that TLS
    // connection, also verify that C.tokenBinding.id matches the base64url encoding of the Token
    // Binding ID for the connection.
    //
    // 11. Let hash be the result of computing a hash over response.clientDataJSON using SHA-256.
    // let mut client_data_json = [0; response.client_data_json_len()];
    let client_data_json_hash =
        std::hash::sha256_var(client_data_json.storage(), client_data_json.len() as u64);
    // 12. Perform CBOR decoding on the attestationObject field of the
    // AuthenticatorAttestationResponse structure to obtain the attestation statement format fmt,
    // the authenticator data authData, and the attestation statement attStmt.
    // TODO: impl parse_attestation_object
    // let attestation_object = parse_attestation_object(response.attestation_object());
    // let auth_data = attestation_object.auth_data();
    //
    // 13. Verify that the rpIdHash in authData is the SHA-256 hash of the RP ID expected by the
    // Relying Party.
    // let expected_rp_id_hash = std::hash::sha256_var(expected_rp_id, expected_rp_id.len() as u64);
    // assert(
    //     auth_data.rp_id_hash() == expected_rp_id_hash,
    //     "InvalidRegistrationResponse: Unexpected RP ID hash",
    // );
    //
    // // 14. Verify that the User Present bit of the flags in authData is set.
    // assert(
    //     auth_data.flags().up(),
    //     "InvalidRegistrationResponse: User was not present during attestation",
    // );
    //
    // SKIP OPTIONAL
    // 15. If user verification is required for this registration, verify that the User Verified bit
    // of the flags in authData is set.
    //
    // 16. Verify that the "alg" parameter in the credential public key in authData matches the alg
    // attribute of one of the items in options.pubKeyCredParams.
    //
    // SKIP OPTIONAL
    // 17. extensions
    //
    // 18. Determine the attestation statement format by performing a USASCII case-sensitive match
    // on fmt against the set of supported WebAuthn Attestation Statement Format Identifier values.
    // An up-to-date list of registered WebAuthn Attestation Statement Format Identifier values is
    // maintained in the IANA "WebAuthn Attestation Statement Format Identifiers" registry
    // [IANA-WebAuthn-Registries] established by [RFC8809].
    // TODO
    //
    // 19. Verify that attStmt is a correct attestation statement, conveying a valid attestation
    // signature, by using the attestation statement format fmt's verification procedure given
    // attStmt, authData and hash.
}

